const Contact = () => {
  return (
    <div className="contact">
      <h1>Contact me!</h1>
      <img
              src="https://raw.githubusercontent.com/amnasyeda/react-portfolio/main/public/css/contact.png"
              alt="contact"
            />
      <iframe
        src=""
        frameBorder="0"
        allowFullScreen=""
        aria-hidden="false"
        tabIndex="0"
      ></iframe>

      <h4>Email</h4>
      <p>amna.syeda98@gmail.com</p>

    </div>
  );
};


export default Contact;
